import React from 'react'
import styled from 'styled-components'

export default function Home() {
  return (
    <MainContainer>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
        <p>Home page</p>
    </MainContainer>
  )
}

const MainContainer = styled.div`
  width: 100%;
  position: absolute;
  top: 90%;
  left: 0%;
`;
